--Creando EXPEDIENTE
CREATE TABLE expediente (
   n_id_expede NUMBER(12),
   d_fecaex DATE,
   c_carfun VARCHAR2(100),
   n_id_proced NUMBER(12),
   c_tipcom NUMBER(10),
   c_tipobj NUMBER(10),
   c_norapl NUMBER(10),
   C_TIPSEL NUMBER(10),
   C_MODSEL NUMBER(10),
   C_NUMSEL NUMBER(10),
   C_DESOBJ VARCHAR2(1000),
   D_FECCPO DATE,
   C_VALRET NUMBER(20,2),
   C_USUCRE NUMBER(13),
   D_FECCRE DATE,
   C_USUUMO NUMBER(13),
   D_FECUMO DATE,
   D_FECAME DATE,
   C_NUMCNV NUMBER(13),
   n_id_organ NUMBER(12),
   N_ESTADO NUMBER(13),
   C_NOMETS VARCHAR2(100),
   C_ANOCON NUMBER(4),
   C_CAUSAL NUMBER(10),
   C_ANINOM  NUMBER(4),
   N_VERSION  NUMBER(4),
   C_TIPDOC NUMBER(4),
   N_ID_SIGENT NUMBER(12),
   C_VALRET_ORIG NUMBER(20,2),
   CONSTRAINT expediente_pk PRIMARY KEY (n_id_expede),
   CONSTRAINT sig_exp_fk FOREIGN KEY (N_ID_SIGENT) REFERENCES sigla_entidad(n_id_sigent),
   CONSTRAINT ent_exp_fk FOREIGN KEY (n_id_organ) REFERENCES entidad(n_id_organ)
);

